import { Component } from "react";
import PhoneComp from "./PhonesComp_Child";

class PersonComp extends Component
{
    constructor()
    {
        super()
    }

    render()
    {
        return (<div style={{border:"solid blue 4px"}}>
            <h1>Person Comp</h1>
            Name: Avi<br/>
            City: Tel Aviv <br/>

            <PhoneComp phones={{homephone: "09-1234567", mobile:"054-1234567", fax:"09-7654321"}}/>

        </div>)
    }
}

export default PersonComp;
